const styles = (theme) => ({
  title: {
    fontWeight: theme.typography.fontWeightMedium,
  },
  buttons: {
    padding: theme.spacing(2.5, 4),
  },
  multiSelect: {
    marginTop: theme.spacing(0),
  },
});

export default styles;
